import{_ as r}from"./plugin-vue_export-helper-DlAUqK2U.js";import{r as n,o as C,c,d as A,e,a as Q,f as I}from"./app-CWuDv3jw.js";const v={},k={href:"https://www.bilibili.com/video/BV1Qp4y1n7EN",target:"_blank",rel:"noopener noreferrer"},u=A("blockquote",null,[A("p",null,"学习大数据之前，需要掌握如下技能：Java基础、Maven、Linux")],-1),t={href:"https://zh.wikipedia.org/wiki/Apache_Hadoop",target:"_blank",rel:"noopener noreferrer"},J={href:"https://hadoop.apache.org/",target:"_blank",rel:"noopener noreferrer"},S={href:"https://hadoop.apache.org/docs/",target:"_blank",rel:"noopener noreferrer"},p={href:"https://hadoop.apache.org/releases.html",target:"_blank",rel:"noopener noreferrer"},a=A("code",null,"binary",-1),g=I('<h2 id="介绍" tabindex="-1"><a class="header-anchor" href="#介绍"><span>介绍</span></a></h2><p>狭义上Hadoop指的是Apache软件基金会的一款开源软件，用Java语言实现，允许用户使用<strong>简单的编程模型</strong>实现<strong>跨机器</strong>集群对海量数据进行<strong>分布式计算</strong>处理</p><p>广义上Hadoop指的是围绕Hadoop打造的大数据生态圈</p><p>Hadoop核心组件：</p><ul><li><code>Hadoop HDFS(分布式文件存储系统)</code>：解决海量数据存储。HDFS作为分布式文件存储系统，处在生态圈的<strong>底层</strong>与<strong>核心</strong>地位</li><li><code>Hadoop YARN(集群资源管理和任务调度框架)</code>：解决资源任务调度（这里的资源指的是CPU、内存等调度）。YARN作为分布式通用的集群资源管理系统和任务调度平台，<strong>支撑各种计算</strong><code>引擎运行</code>，保证了Hadoop地位</li><li><code>Hadoop MapReduce(分布式计算框架)</code>：解决海量数据计算。MapReduce作为大数据生态圈第一代分布式计算引擎，由于自身设计的模型所产生的弊端，导致企业一线<strong>几乎不再直接使用</strong>MapReduce进行编程处理，但是很多软件的底层依然在使用MapReduce引擎来处理数据。<code>MapReduce</code> 简称为 <code>MR</code></li></ul><h3 id="特性优点" tabindex="-1"><a class="header-anchor" href="#特性优点"><span>特性优点</span></a></h3><ul><li><code>scalability</code>(扩容能力)：Hadoop是在可用的计算机集群间分配数据并完成计算任务的，这些集群可方便灵活的方式扩展到数以干计的节点。</li><li><code>Economical</code>(成本低)：Hadoop集群允许通过部署普通廉价的机器组成集群来处理大数据，以至于成本很低。看重的是集群整体能力。</li><li><code>efficiency</code>(效率高)：通过<code>并发数据</code>，Hadoop可以在节点之间动态<code>并行</code>的移动数据，使得速度非常快。</li><li><code>reliability</code>(可靠性)：能自动维护数据的多份复制，并且在任务失败后能自动地重新部署(redeploy)计算任务。所以Hadoop的按位存储和处理数据的能力值得人们信赖。</li></ul><h3 id="商业发行版" tabindex="-1"><a class="header-anchor" href="#商业发行版"><span>商业发行版</span></a></h3>',8),f={href:"https://www.cloudera.com/open-source.html#",target:"_blank",rel:"noopener noreferrer"},E=I('<p>Hadoop 2.0版本比1.0版本新增了 <code>YARN</code> 和对其他计算框架的支持，3.0和2.0比较起来，只是性能更优化了</p><h2 id="集群概述" tabindex="-1"><a class="header-anchor" href="#集群概述"><span>集群概述</span></a></h2><p>Hadoop集群包括两个集群：<code>HDFS集群</code> 和 <code>YARN集群</code></p><p>两个集群 <code>逻辑上分离，物理上在一起</code></p><p>两个集群都是标准的 <code>主从架构</code> 集群</p><h3 id="hdfs集群" tabindex="-1"><a class="header-anchor" href="#hdfs集群"><span>HDFS集群</span></a></h3><p><code>HDFS集群</code> 是一个分布式存储系统</p><p>主要角色是 <code>NameNode</code> 简称 <code>NN</code>，次要角色是 <code>DataNode</code> 简称 <code>DN</code>，主要角色的辅助角色是 <code>SecondaryNameNode</code> 简称 <code>SNN</code></p><p>例如有三台服务器，分别是 node1、node2、node3</p><p>我们的最终目的就是把上面的三个角色都部署起来，因为这些角色都是<code>各自独立</code>的进程</p><p>例如我在 node1机器 上部署一个 <code>NN</code>，在 node2机器 上部署 <code>SNN</code>，然后在node1、node2、node3这三台机器上都部署 <code>DN</code></p><p>这样就形成了一主三从外加一个秘书的HDFS集群</p><img src="data:image/png;base64,"><h3 id="yarn集群" tabindex="-1"><a class="header-anchor" href="#yarn集群"><span>YARN集群</span></a></h3><p><code>YARN集群</code>主要负责资源管理和调度</p><p>主要角色是 <code>ResourceManager</code> 简称 <code>RM</code>，次要角色是 <code>NodeManager</code> 简称 <code>NM</code></p><p>承接上面的HDFS集群内容，我现在再在 node1机器 上部署一个 <code>RM</code>，然后在node1、node2、node3这三台机器上都部署 <code>NM</code></p><p>这四个角色就组成了另外一个集群，也就是 <code>YARN集群</code></p><img src="data:image/png;base64,"><p>到这里，Hadoop集群就出现了，Hadoop集群必须是 <code>HDFS集群</code> + <code>YARN</code> 集群</p><p>逻辑上分离指的是两个集群之间没有依赖关系，物理上在一起的意思是这些进程很大可能部署在同一个机器上</p><p>MapReduce是计算框架、代码层面的组件，没有集群的说法</p>',22);function B(o,s){const d=n("ExternalLinkIcon");return C(),c("div",null,[A("p",null,[e("相关课程："),A("a",k,[e("https://www.bilibili.com/video/BV1Qp4y1n7EN"),Q(d)])]),u,A("p",null,[e("维基百科："),A("a",t,[e("https://zh.wikipedia.org/wiki/Apache_Hadoop"),Q(d)])]),A("p",null,[e("官网："),A("a",J,[e("https://hadoop.apache.org/"),Q(d)])]),A("p",null,[e("文档地址，需要手动选版本："),A("a",S,[e("https://hadoop.apache.org/docs/"),Q(d)])]),A("p",null,[e("下载地址："),A("a",p,[e("https://hadoop.apache.org/releases.html"),Q(d)]),e("，下载 "),a,e(" 二进制文件就好")]),g,A("p",null,[e("Cloudera："),A("a",f,[e("https://www.cloudera.com/open-source.html#"),Q(d)])]),E])}const O=r(v,[["render",B],["__file","index.html.vue"]]);export{O as default};
